import './App.scss';
import Card from './components/card/card';





const App = () =>  {
  
  return (
    <main className="main">
      <description className="description">Похожие объвления</description>
      <div className="App">
        <Card/>
      </div>
      <div className="showMore">
        <span className="text"></span>
        <span className="expand"></span>
      </div>
    </main>
  );
}

export default App;
